import "./App.css";
import allCountryScores from "./score";

function App() {
  return (
    <div className="App">
      <h1>High Score Per Country</h1>
      <div>
        {allCountryScores.map((country, index) => (
          <ul key={index}>
            <li>HIGH SCORES:{country.name}</li>
          </ul>
        ))}
      </div>
    </div>
  );
}

export default App;
